import s from "./Cart.module.scss"
import {useNavigate} from "react-router-dom";
const Cart = () => {
    const goHome = useNavigate("/");
    return(
        <div className={s.Cart}>
            <h1>This is empty cart</h1>
            <button onClick={goHome}>Back</button>
        </div>
    )
}
export default Cart
